import {FaHamburger } from 'react-icons/fa';
//import { } from 'react-icons/fa';

import {FaFacebookSquare } from 'react-icons/fa';
import { FaTimesCircle } from 'react-icons/fa';
import './Navbar.css';
//import { useRef } from 'react';

function Navbar(){  



    return(
        
        <div>
            <div>
                <h4>Logo</h4>
            </div>


            <nav className="nav">

                <input type="checkbox" id="nav-checkbox"
                className="nav-checkbox"></input>

                <label for="nav-checkbox" className="nav-toggle">
                  <FaHamburger className="openMenu"/>
                  < FaTimesCircle className="closeMenu"/>
                </label>


                <ul className="nav-menu">
                    <li><a href="">logo</a></li>
                    <li><a href="">about</a></li>
                    <li><a href="">work</a></li>
                    <li><a href="">contact</a></li>
                </ul>

            </nav>






    
            
        </div>
    )
}
export default Navbar;


/*  

    NOTE: what the {toggle menu} mean is that if toggle menu is false,
    it won't show anything but if it is true, it would show the navbar


*/
